import React, { useEffect, useState} from 'react'
import { useLocation, useNavigate } from 'react-router-dom'

function AddResults() {
    const location = useLocation()
    const navigate = useNavigate()
    const [marks1, setMarks1] = useState(null)
    const [marks2, setMarks2] = useState(null)
    const [marks3, setMarks3] = useState(null)
    const [marks4, setMarks4] = useState(null)
    const [marks5, setMarks5] = useState(null)
    
    const {user, 
      examinfo: {year, branch, heldin}, 
      subjects: {sub1, sub2, sub3, sub4, sub5}} = location.state

    useEffect(()=>{
      console.log(location.state)
      if(location.state == null ){
        window.alert('Not logged in')
        navigate('/Teacher/Teacherlogin')
      }
    })
    
    const nextHandler = () =>{

    }
    // ,
    // 'subjects': {
    //     'sub1': sub1,
    //     'sub2': sub2,
    //     'sub3': sub3,
    //     'sub4': sub4,
    //     'sub5': sub5
    // }
  return (
    <div>
      <h1>Logged in as: {user}</h1>
      <div>
        <h2>Year: {year}</h2>
        <h2>Branch: {branch}</h2>
        <h2>Held in: {heldin}</h2>
      </div>
      <div>
        <div>
            <h2>{sub1}</h2>
            <input type='text' onChange={(e) => setMarks1(e.target.value)}/>
        </div>
        <div>
            <h2>{sub2}</h2>
            <input type='text' onChange={(e) => setMarks2(e.target.value)}/>
        </div>
        <div>
            <h2>{sub3}</h2>
            <input type='text' onChange={(e) => setMarks3(e.target.value)}/>
        </div>
        <div>
            <h2>{sub4}</h2>
            <input type='text' onChange={(e) => setMarks4(e.target.value)}/>
        </div>
        <div>
            <h2>{sub5}</h2>
            <input type='text' onChange={(e) => setMarks5(e.target.value)}/>
        </div>
      </div>
      <div>
        <button type='button' onClick={nextHandler}>Next</button>
        <button type='button'>Submit</button>
      </div>
    </div>
  )
}

export default AddResults
